import React from 'react'
import {logo} from './logo.png'

function HeaderTop() {
  return (
    <div className='header-top'>
      <div className="logo-container">
        <img src={logo} alt="logo" className='logo-img' />
        <p className="logo">Affariyett</p>
      </div>
    </div>
  )
}

export default HeaderTop
